import React from 'react';
import './footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-subtitle">
        <span>feedback@example.com 메일로 의견 보내기</span>
      </div>
    </footer>
  );
}

export default Footer;
